import styled from "styled-components";

export const Label = styled.label`
    display: flex;
    border: 1pt solid rgba(9,9,9,0.1);
    margin-bottom: 15px;
    padding: 5px; 
    p {
      color: black;
      border: 0px;
      margin-right: 20px;
      padding: 0px;
    }
    select {
      background-color: gray;
      height: 30px;
      margin: 3px;
      cursor: pointer;
    }

`;
